(180, 'elementor_remote_info_feed_data', 'a:3:{i:0;a:5:{s:5:\"title\";s:86:\"New in Elementor 3.17 - Enhance Visitor Experience With AJAX, Faster Websites and More\";s:7:\"excerpt\";s:173:\"Elementor 3.17 introduces AJAX Loading for Loop Grids, improves image loading speed, adds the ability to access past prompts and content generated by Elementor AI, and more.\";s:7:\"created\";i:1698835967;s:5:\"badge\";s:3:\"NEW\";s:3:\"url\";s:150:\"https://elementor.com/blog/elementor-317-loop-grid-ajax-loading-rating-widget/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:1;a:5:{s:5:\"title\";s:73:\"Elementor 3.16 - Faster Performance, Flexible Design, and more Accessible\";s:7:\"excerpt\";s:210:\"Elementor 3.16 activates Flexbox Containers by default for new websites, improves site loading speed with performance enhancements, increases accessibility for visitors who use assistive technologies, and more.\";s:7:\"created\";i:1695134049;s:5:\"badge\";s:3:\"NEW\";s:3:\"url\";s:152:\"https://elementor.com/blog/316-faster-performance-flexible-design-accessibility/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:2;a:5:{s:5:\"title\";s:59:\"Enhance Your Workflow With Elementor’s AI Image Generator\";s:7:\"excerpt\";s:352:\"Elementor AI\'s image editing tools revolutionize web design, enabling custom image generation and seamless editing. With diverse features like image variations, generative fill, and background tools, it empowers web creators to enhance visuals effortlessly. Embrace the future of web design with Elementor AI\'s revolutionary image editing capabilities.\";s:7:\"created\";i:1692185885;s:5:\"badge\";s:3:\"NEW\";s:3:\"url\";s:156:\"https://elementor.com/blog/enhance-your-workflow-with-elementors-ai-image-generator/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}}', 'no'),
