sectetur nulla rhoncus a a id felis praesent.Tempus dui integer a cursus id fames parturient.<\\/p>\",\"_id\":\"8b4af4e\",\"image\":{\"id\":265,\"url\":\"http:\\/\\/localhost\\/onlinestore\\/wp-content\\/uploads\\/2023\\/11\\/placeholder-2.png\"}},{\"item_title\":\"Will you restock items indicated as \\u201cout of stock?\\u201d\",\"item_content\":\"<p>Scelerisque parturient sagittis nisi in aliquam dui scelerisque non consectetur aptent hac adipiscing ullamcorper pulvinar sit vestibulum purus facilisi hendrerit mus nisl massa ut parturient consectetur cum justo fames torquent.<\\/p><p>Ac curae aliquet vivamus aptent duis congue urna venenatis ridiculus faucibus tincidunt a lorem rutrum nullam potenti adipiscing.Adipiscing.<\\/p>\",\"_id\":\"a933bda\",\"image\":{\"id\":266,\"url\":\"http:\\/\\/localhost\\/onlinestore\\/wp-content\\/uploads\\/2023\\/11\\/placeholder-3.png\"}},{\"item_title\":\"Where can I ship my order?\",\"item_content\":\"<p>Ut bibendum a adipiscing purus massa a facilisi congue parturient condimentum urna donec per adipiscing cursus nisl nam tristique parturient id.<\\/p><p>Aliquam quam at et in ipsum at venenatis a eget dignissim aliquam tincidunt ultrices lacus ad consectetur imperdiet sem suspendisse ante a dapibus potenti.Eu parturient parturient magnis tempus molestie augue quam vulputate hac facilisis est nisl pretium a cursus.<\\/p>\",\"_id\":\"a6d14b0\",\"image\":{\"id\":267,\"url\":\"http:\\/\\/localhost\\/onlinestore\\/wp-content\\/uploads\\/2023\\/11\\/placeholder-4.png\"}}],\"title_typography_typography\":\"custom\",\"title_typography_font_family\":\"Lato\",\"opener_alignment\":\"right\",\"scroll_y\":-80,\"title_typography_font_size\":{\"unit\":\"px\",\"size\":16,\"sizes\":[]}},\"elements\":[],\"widgetType\":\"wd_accordion\"}],\"isInner\":\"\"},{\"id\":\"686257e2\",\"elType\":\"column\",\"settings\":{\"_column_size\":\"50\",\"column_sticky_offset\":\"50\",\"scroll_y\":\"-80\",\"_inline_size_tablet\":\"100\",\"padding\":{\"unit\":\"px\",