(261, 1, '2023-11-16 16:09:36', '2023-11-16 10:24:36', '<link rel=\"stylesheet\" id=\"wd-section-title-css\" href=\"http://localhost/onlinestore/wp-content/themes/woodmart/css/parts/el-section-title.min.css?ver=7.3.2\" type=\"text/css\" media=\"all\" /> 					\n					SOME WORDS ABOUT US				\n				<h4>Well-coordinated teamwork speaks About Us</h4> \n						<link rel=\"stylesheet\" id=\"wd-info-box-css\" href=\"http://localhost/onlinestore/wp-content/themes/woodmart/css/parts/el-info-box.min.css?ver=7.3.2\" type=\"text/css\" media=\"all\" /> 					\n											<h4						class=\"info-box-title title box-title-style-default wd-fontsize-m\" data-elementor-setting-key=\"title\">\n								We love what we do						</h4>\n					<p>A small river named Duden flows by their place and supplies it with the necessary regelialia.</p>\n			<a  href=\"#\">\n					Read more				\n							</a>\n											<h4						class=\"info-box-title title box-title-style-default wd-fontsize-m\" data-elementor-setting-key=\"title\">\n								Our working process						</h4>\n					<p>She packed her seven versalia, put her initial into the belt and made herself on the way.</p>\n			<a  href=\"#\">\n					Read more				\n							</a>\n								<img width=\"580\" height=\"580\" src=\"http://localhost/onlinestore/wp-content/uploads/2023/11/about-us-3-image-1.jpg\" alt=\"\" decoding=\"async\" srcset=\"http://localhost/onlinestore/wp-content/uploads/2023/11/about-us-3-image-1.jpg 580w, http://localhost/onlinestore/wp-content/uploads/2023/11/about-us-3-image-1-300x300.jpg 300w, http://localhost/onlinestore/wp-content/uploads/2023/11/about-us-3-image-1-150x150.jpg 150w\" sizes=\"(max-width: 580px) 100vw, 580px\" />					\n					SEEMINGLY ELEGANT DESIGN				\n				<h4>About our online store</h4> \n					<p><em>Risus suspendisse a orci penatibus a felis suscipit consectetur vestibulum sodales dui cum ultricies lacus interdum.</em></p>				\n						<link rel=\"stylesheet\" id=\"wd-text-block-css\" href=\"http://localhost/onlinestore/wp-