ink\">\n											</a>\n					WORDS ABOUT US				\n				<h4>Our Team</h4> \n					<p>Convallis ullamcorper aliquet ultrices orci cum vestibulum lobortis erat.</p>				\n						<link rel=\"stylesheet\" id=\"wd-team-member-css\" href=\"http://localhost/onlinestore/wp-content/themes/woodmart/css/parts/el-team-member.min.css?ver=7.3.2\" type=\"text/css\" media=\"all\" /> 					\n						<img width=\"400\" height=\"643\" src=\"http://localhost/onlinestore/wp-content/uploads/2023/11/about-us-3-team-member-1.jpg\" alt=\"\" decoding=\"async\" srcset=\"http://localhost/onlinestore/wp-content/uploads/2023/11/about-us-3-team-member-1.jpg 400w, http://localhost/onlinestore/wp-content/uploads/2023/11/about-us-3-team-member-1-187x300.jpg 187w, http://localhost/onlinestore/wp-content/uploads/2023/11/about-us-3-team-member-1-150x241.jpg 150w\" sizes=\"(max-width: 400px) 100vw, 400px\" />					\n									<h4>\n						Mark Jance					</h4>\n						CEO / FOUNDER					\n									<a rel=\"noopener noreferrer nofollow\" href=\"#\">\n					</a>\n									<a rel=\"noopener noreferrer nofollow\" href=\"#\">\n					</a>\n									<a rel=\"noopener noreferrer nofollow\" href=\"#\">\n					</a>\n									<a rel=\"noopener noreferrer nofollow\" href=\"#\">\n					</a>\n						<img width=\"400\" height=\"643\" src=\"http://localhost/onlinestore/wp-content/uploads/2023/11/about-us-3-team-member-2.jpg\" alt=\"\" decoding=\"async\" srcset=\"http://localhost/onlinestore/wp-content/uploads/2023/11/about-us-3-team-member-2.jpg 400w, http://localhost/onlinestore/wp-content/uploads/2023/11/about-us-3-team-member-2-187x300.jpg 187w, http://localhost/onlinestore/wp-content/uploads/2023/11/about-us-3-team-member-2-150x241.jpg 150w\" sizes=\"(max-width: 400px) 100vw, 400px\" />					\n									<h4>\n						Aviana Plummer					</h4>\n						CEO / FOUNDER					\n									<a rel=\"noopener noreferrer nofollow\" href=\"#\">\n					</a>\n									<a rel=\"noopener noreferrer nofollow\" href=\"#\">\n					</a>\n									<a rel=\"noopener